  [],\n\t\"revision_timestamp\": \"2015-07-08T19:06:02.808022\",\n\t\"name\": \"airs-aqua-level-3-monthly-co2-in-the-free-troposphere-airsamsu-v005\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This is the AIRS mid-tropospheric Carbon
  Dioxide (CO2) Level 3 Monthly Gridded Retrieval, from the AIRS and AMSU instruments
  on board of Aqua satellite. It is a monthly gridded data, at 2.5x2 deg (lon)x(lat)
  grid cell size. The data is in mole fraction units (data x 10^6 =ppm in volume).
  This quantity is not a total column quantity because the sensitivity function of
  the AIRS mid-tropospheric CO2 retrieval system peaks over the altitude range 6-10
  km. The quantity is what results when the true atmospheric CO2 profile is weighted,
  level-by-level, by the AIRS sensitivity function. The file format is HDF-EOS 2.12
  corresponding to HDF4.n      n      This AIRS mid-tropospheric CO2 Level 3 Monthly
  Gridded Retrieval Product contains standard retrieval means, standard deviations
  and input counts as well as the latitude and longitude arrays giving the centers
  of the grid boxes.  Each file covers a calendar month. The mean values are simply
  the arithmetic means of the individual CO2 retrievals which fall within that grid
  box over the month.n      n      The mid-tropospheric CO2 retrievals have been averaged
  and binned into 2.5 x 2 deg grid cells, from -180.0 to +180.0 deg longitude and
  from -60.0 to +90.0 deg latitude. For each grid map of 4-byte floating-point mean
  values there is a corresponding 4-byte floating-point map of standard deviation
  and a 2-byte integer grid map of counts. The counts map provides the user with the
  number of points per bin that were included in the mean.nn                  (The
  Shortname for this product is AIRX3C2M).\",\n\t\"license_title\": \"U.S. Government
